  \"2015-12-09T02:42:44.841327\",\n\t\"name\": \"contours-offshore-refugio-beach-california\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This part of SIM 3319 presents bathymetric
  contours for several seafloor maps of Offshore Refugio Beach, California (vector
  data file is included in \"Contours_OffshoreRefugioBeach.zip,\" which is accessible
  from http://pubs.usgs.ov/ds/781/OffshoreRefugioBeach/data_catalog_OffshoreRefugioBeach.html).
  Contours of Offshore Refugio Beach, California, were clipped from a larger overall
  contour dataset of all California State Waters within the Santa Barbara Channel.
  These contours were generated from bathymetry data collected by the U.S. Geological
  Survey (USGS), by California State University, Monterey Bay, Seafloor Mapping Lab
  (CSUMB), and by Fugro Pelagos. The USGS conducted mapping within State waters in
  the summers of 2005, 2006, 2007, and 2008 using a combination of 117 kHz and 234.5
  kHz SEA (AP) Ltd. SWATHplus-M phase-differencing sidescan sonars. CSUMB conducted
  mapping in the summers of 2006 and 2007 using a 244 kHz Reson 8101 multibeam echosounder.
  Fugro Pelagos conducted multibeam mapping in 2008 using a combination of 400 kHz
  Reson 7125, 240 kHz Reson 8101, and 100 kHz Reson 8111 multibeam echosounders. Fugro
  Pelagos also conducted coastal bathymetric and topographic lidar mapping in 2009
  for the U.S. Army Corps of Engineers (USACE) Joint Lidar Bathymetry Technical Center
  of Expertise using the SHOALS-1000T bathymetric and the Leica ALS60 topographic
  lidar systems. All of these mapping missions combined to collect bathymetry from
  the 0-m isobath to beyond the 3-nautical mile limit of Californiau0092s state waters.\",\n\t\"license_title\":
